import { useState,useEffect } from 'react';
import axios from '../conexion';

function Encabezado (props){
    var [datos,setOperaciones]= useState([]);

    useEffect(()=>{
        cargar()
    })
    
    const cargar= async ()=>{
        var config = {
            method: 'get',
            url: 'http://localhost:3200/api/operation/'+ props.id,
            headers: { 
              'Content-Type': 'application/x-www-form-urlencoded'
            },
        };
        const operation= await axios(config)
        setOperaciones(operation.data)
    }

    return(
        <div className="Principal">
            <h1>Presupuesto Personal</h1>
            <h2>Su saldo {datos}</h2>
        </div>
    )
}

export default Encabezado;
